import React from 'react'


export default props => {
  
  if (!localStorage.getItem('@react-web/auth')) {
    props.history.push('/login')
  }

  return (
    <div className="Home">
      <div className="Background bg_blue" style={{backgroundColor: white}}></div>
      <p>Home page!</p>
    </div>
  )

}
